import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import { Router, Route, browserHistory } from 'react-router'
import { Link } from 'react-router-dom'

export default class componentName extends Component {
  render() {
    return (
        <div className="container">
        <div className="btn-group btn-group-toggle" data-toggle="buttons">
        <Link to="/mors" activeClassName="active" className={("btn btn-primary", "btn btn-primary btn-lg")} >ALFABER MORSA</Link>
          <button
            onClick={() => this.hideComponent("showHideAffine")}
            className={("btn btn-primary", "btn btn-primary btn-lg")}
          >
            SZYFR AFINICZNY
          </button>
          <button
            onClick={() => this.hideComponent("showHideVigenere")}
            className={("btn btn-primary", "btn btn-primary btn-lg")}
          >
            SZYFR VIGENERE'A
          </button>
        </div>

      </div>
    );
  }
}
